import Link from "next/link";

const Header = () => (
  <>
    <div className="navbar">
      <Link href="/">
        <a className="navlink logo">WooYoungChoi</a>
      </Link>
      <Link href="/">
        <a className="navlink">Home</a>
      </Link>
      <Link href="/about">
        <a className="navlink">About</a>
      </Link>
      <style jsx>
        {`
          .navbar {
            display: inline-block;
            width: 100%;
            border: solid;
          }

          .navlink {
            display: inline-block;
            margin: 0;
            padding: 0;
            float: right;
            font-family: "Arial";
            margin-right: 15px;
            text-decoration: none;
          }

          .logo {
            float: left;
            font-family: "futura";
            font-size: 20px;
            font-weight: bold;
            color: #00ace6;
          }

          .navlink:hover {
            opacity: 0.6;
          }
        `}
      </style>
    </div>
  </>
);

export default Header;
